import React, { useState, useEffect, useCallback } from 'react';
import { MapContainer, TileLayer, Marker, Popup, Polyline } from 'react-leaflet';
import L from 'leaflet';
import io from 'socket.io-client';
import 'leaflet/dist/leaflet.css';

// Define vehicle styles for different vehicle IDs
const vehicleStyles = {
  vehicle1: { 
    icon: L.icon({
      iconUrl: '/tractor_2548747.png',
      iconSize: [32, 32],
      iconAnchor: [16, 32],
      popupAnchor: [0, -32]
    }),
    pathColor: 'blue'
  },
  vehicle2: { 
    icon: L.icon({
      iconUrl: '/vecteezy_tractor-png-with-ai-generated_26773255.png',
      iconSize: [32, 32],
      iconAnchor: [16, 32],
      popupAnchor: [0, -32]
    }),
    pathColor: 'red'
  },
  vehicle3: { 
    icon: L.icon({
      iconUrl: '/vecteezy_construction-vehicle-3d-render-clipart_31614137.png',
      iconSize: [32, 32],
      iconAnchor: [16, 32],
      popupAnchor: [0, -32]
    }),
    pathColor: 'green'
  }
};

const defaultStyle = {
  icon: L.icon({
    iconUrl: '/vecteezy_tractor-png-with-ai-generated_26773255.png',
    iconSize: [32, 32],
    iconAnchor: [16, 32],
    popupAnchor: [0, -32]
  }),
  pathColor: 'gray'
};

function VehicleTracker() {
  const [vehicles, setVehicles] = useState({});
  const [trackedPaths, setTrackedPaths] = useState({});

  // Maximum number of historical positions to store per vehicle
  const MAX_POSITIONS = 500;

  // Callback to update vehicle position from received data
  const updateVehiclePosition = useCallback((data) => {
    // Expected data format:
    // { id: "vehicle1", name: "Tractor A", latitude: 22.317094, longitude: 87.314139 }
    if (!data || !data.id || data.latitude == null || data.longitude == null) {
      return;
    }

    setVehicles(prevVehicles => {
      const newVehicles = { ...prevVehicles };

      // If the vehicle does not exist yet, create its entry.
      if (!newVehicles[data.id]) {
        newVehicles[data.id] = {
          id: data.id,
          name: data.name || data.id, // Use provided name or fallback to id
          currentPosition: null,
          lastUpdateTime: null
        };
      }

      // Update the current position and last update time.
      newVehicles[data.id].currentPosition = { 
        lat: data.latitude, 
        lng: data.longitude 
      };
      newVehicles[data.id].lastUpdateTime = Date.now();

      // If a name is provided in the payload, update it.
      if (data.name) {
        newVehicles[data.id].name = data.name;
      }

      return newVehicles;
    });

    // Update tracked paths for the vehicle
    setTrackedPaths(prevPaths => {
      const newPaths = { ...prevPaths };

      // Initialize path array if needed.
      if (!newPaths[data.id]) {
        newPaths[data.id] = [];
      }

      // Add the new position with a timestamp.
      newPaths[data.id].push({ 
        lat: data.latitude, 
        lng: data.longitude,
        timestamp: Date.now()
      });

      // Limit the number of stored positions.
      if (newPaths[data.id].length > MAX_POSITIONS) {
        newPaths[data.id].shift();
      }

      return newPaths;
    });
  }, []);

  useEffect(() => {
    // Create the Socket.IO connection to the backend.
    const socket = io('http://localhost:8080');

    // Listen for "vehicle-position-update" events from the backend.
    socket.on('vehicle-position-update', updateVehiclePosition);

    // Cleanup the socket connection on component unmount.
    return () => {
      socket.disconnect();
    };
  }, [updateVehiclePosition]); 

  return (
    <MapContainer 
      center={[22.346010, 87.315221]} 
      zoom={13} 
      style={{ height: '500px', width: '100%' }}
    >
      <TileLayer
        url="https://tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      />
      {Object.keys(vehicles).map(id => {
        const vehicle = vehicles[id];
        const path = trackedPaths[id] || [];
        const style = vehicleStyles[id] || defaultStyle;

        // Convert tracked path positions to an array for the Polyline.
        const positions = path.map(pos => [pos.lat, pos.lng]);

        return (
          <React.Fragment key={id}>
            {positions.length > 1 && (
              <Polyline 
                positions={positions} 
                color={style.pathColor} 
                weight={3}
              />
            )}
            {vehicle.currentPosition && (
              <Marker 
                position={[
                  vehicle.currentPosition.lat, 
                  vehicle.currentPosition.lng
                ]} 
                icon={style.icon}
              >
                <Popup>
                  <strong>{vehicle.name}</strong><br/>
                  Last Update: {new Date(vehicle.lastUpdateTime).toLocaleString()}
                </Popup>
              </Marker>
            )}
          </React.Fragment>
        );
      })}
    </MapContainer>
  );
}

export default VehicleTracker;
